    <div>
      <form onSubmit={handleSubmit}>
        <input type="text" onChange = {usernameHandler} placeholder="username"></input>
        <input type="password" onChange = {passwordHandler} placeholder="password"></input>
        <button type="submit">submit</button>
      </form>
    </div>
  );
}

export default App;
